import {IoLogoFacebook} from "react-icons/io"
const Footer = () => {
  return (
    <footer>
      <div>
        <h3>John Y.</h3>
        <ul>
          <li>
            <IoLogoFacebook />
          </li>
        </ul>
      </div>
    </footer>
  );
};

export default Footer;
